import React from 'react'

const Controls = ({ onClickDeleteProduct, onClickOrderByDate}) => {
    return(
        <div>
            <button onClick={onClickDeleteProduct}></button>
            <button onClick={onClickOrderByDate}></button>
        </div>
    )
}

export default Controls
